import React from "react";

const Weather = props => (
    <div>
    {	
        props.city && props.country && <p className="weather__country"> { props.city }, { props.country }
        </p> 
      }
      { 	
        props.temperature && <p className="weather__temp"> { props.temperature }	<span></span>
        </p> 
      }

      <div className="weather__humidity"> { props.humidity } </div>

      <div className="weather__desc"> { props.description } </div>

            { 
                props.error && <p className="weather__error">{ props.error }</p>  
            }
 </div>
);


export default Weather;
